  `kota` varchar(50) DEFAULT NULL,
  `kodepos` varchar(10) DEFAULT NULL,
  `negara` varchar(50) DEFAULT NULL,
  `telp` varchar(50) DEFAULT NULL,
  `fax` varchar(50) DEFAULT NULL,
  `email` varchar(50) DEFAULT NULL,
  `website` varchar(50) DEFAULT NULL,
  `npwp` varchar(50) DEFAULT NULL,
  `jenis_kelamin` varchar(1) DEFAULT NULL,
  `tgl_lahir` date DEFAULT NULL,
  `tgl_masuk` date DEFAULT NULL,
  `status_kerja` varchar(20) DEFAULT NULL,
  `jabatan` varchar(50) DEFAULT NULL,
  `hubungi_nama` varchar(50) DEFAULT NULL,
  `hubungi_telp` varchar(50) DEFAULT NULL,
  `kode_pos` varchar(10) DEFAULT NULL,
  `no_rek` varchar(50) DEFAULT NULL,
  `ket` varchar(50) DEFAULT NULL,
  `sales_code` varchar(50) DEFAULT NULL,
  `kode_wilayah` varchar(50) DEFAULT NULL,
  `sales_name` varchar(100) DEFAULT NULL,
  `flag_import` int(11) DEFAULT NULL,
  PRIMARY KEY (`contact_code`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

